@ElstoneGutters @Lilybil24762994 @statsjamie The reported Vaccine efficacy is based on relative risk reduction (RRR).
What they should report on is the absolute risk reduction (ARR). ARR's are ignored because they give a much less impressive effect size than RRRs: 1·3% for AstraZeneca, and 0·84% for Pfizer.
